import React, { Component } from 'react'
import { programs } from './UserFunctions'
import "./Programs.css"

class ProgramsList extends Component {
    constructor() {
        super();
        this.state = {
            programList: [],
        }

    }         
    componentDidMount() {
        console.log('mounted')

        programs().then(res => {

            if(!res.error) {
                this.setState({
                    programList: res.programs
                })
                console.log(this.state.programList)


            } else{
                console.log("error in axios request: apidata")
            }     
        })

    }

    render(){
        if(!this.state.programList.length)
            return null;
        let credentials = this.state.programList.map((v, i) =>(
            <h1 key={i} className='program' { ...v.program}{ ...v.password } />
        ))
        return (
        <h1> {credentials} </h1>
        )
    }
}

export default ProgramsList
